export default function Board() {
  return (
    <>
      <div className="board-row">
        <Square number="1" />
        <Square number="1" />
        <Square number="1" />
      </div>
      <div className="board-row">
        <Square number="1" />
        <Square number="1" />
        <Square number="1" />
      </div>
      <div className="board-row">
        <Square />
        <Square />
        <Square />
      </div>
    </>
  );
}

function Square({ number }) {
  return <button className="square">{number}</button>;
}
